import React from "react";
import { Food } from "./Food";

export function FoodTile(data: Food) {
  return (<div>
    <h2>{data.id}</h2>
    <h2>{data.ingredients}</h2>
    <h2>{data.name}</h2>
    <h2>{data.price}</h2>
  </div>)
}
